Opening src/main.rs, we have an empty main function. To start, we create the closure that we want to fuzz. It takes a buffer as input and panics if it starts with "abc". ExitKind is used to inform the fuzzer about the harness' exit status. extern crate libafl;
extern crate libafl_bolts;
use libafl::{ executors::ExitKind, inputs::{BytesInput, HasTargetBytes},
};
use libafl_bolts::AsSlice; fn main() { let mut harness = |input: &BytesInput| { let target = input.target_bytes(); let buf = target.as_slice(); if buf.len() > 0 && buf[0] == 'a' as u8 { if buf.len() > 1 && buf[1] == 'b' as u8 { if buf.len() > 2 && buf[2] == 'c' as u8 { panic!("=)"); } } } ExitKind::Ok }; // To test the panic: let input = BytesInput::new(Vec::from("abc")); #[cfg(feature = "panic")] harness(&input);
} To test the crash manually, you can add a feature in Cargo.toml that enables the call that triggers the panic: [features] And then run the program with that feature activated: $ cargo run -F panic And you should see the program crash as expected.

