static mut SIGNALS: [u8; 16] = [0; 16]; fn signals_set(idx: usize) { unsafe { SIGNALS[idx] = 1 };
} fn main() { // The closure that we want to fuzz let mut harness = |input: &BytesInput| { let target = input.target_bytes(); let buf = target.as_slice(); signals_set(0); // set SIGNALS[0] if buf.len() > 0 && buf[0] == 'a' as u8 { signals_set(1); // set SIGNALS[1] if buf.len() > 1 && buf[1] == 'b' as u8 { signals_set(2); // set SIGNALS[2] if buf.len() > 2 && buf[2] == 'c' as u8 { panic!("=)"); } } } ExitKind::Ok };
