Suppose you want to fuzz the following program: fn target(input: &[u8]) -> i32 { match &input { // fictitious crashing input &[1, 3, 3, 7] => 1337, // standard error handling code &[] => -1, // representative of normal execution _ => 0 }
} A simple coverage-maximizing fuzzer that generates new inputs somewhat randomly will have a hard time finding an input that triggers the fictitious crashing input. Many techniques have been proposed to make fuzzing less random and more directly attempt to mutate the input to flip specific branches, such as the ones involved in crashing the above program. Concolic tracing allows us to construct an input that exercises a new path in the program (such as the crashing one in the example) analytically instead of stochastically (ie. guessing). In principle, concolic tracing works by observing all executed instructions in an execution of the program that depend on the input. To understand what this entails, we'll run an example with the above program. First, we'll simplify the program to simple if-then-else-statements: fn target(input: &[u8]) -> i32 { if input.len() == 4 { if input[0] == 1 { if input[1] == 3 { if input[2] == 3 { if input[3] == 7 { return 1337; } else { return 0; } } else { return 0; } } else { return 0; } } else { return 0; } } else { if input.len() == 0 { return -1; } else { return 0; } }
} Next, we'll trace the program on the input []. The trace would look like this: Branch { // if input.len() == 4 condition: Equals { left: Variable { name: "input_len" }, right: Integer { value: 4 } }, taken: false // This condition turned out to be false...
}
Branch { // if input.len() == 0 condition: Equals { left: Variable { name: "input_len" }, right: Integer { value: 0 } }, taken: true // This condition turned out to be true!
} Using this trace, we can easily deduce that we can force the program to take a different path by having an input of length 4 or having an input with non-zero length. We do this by negating each branch condition and analytically solving the resulting 'expression'. In fact, we can create these expressions for any computation and give them to an SMT -Solver that will generate an input that satisfies the expression (as long as such an input exists). In hybrid fuzzing, we combine this tracing + solving approach with more traditional fuzzing techniques.

